     &   -(Sqrt(2.D0)*Sub9070(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,
     &        Sfe7)) + Sub9067(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,
     &      Sfe7)*USf(Sfe7,2,4,Gen(1))

        Sub9072(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,Sfe7) = 
     &   (2*(1/2.D0*(F19*S2B*Mf(4,Gen(2))*
     &           Sub9071(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,Sfe7)*
     &           UChaC(Cha(3),2)*USfC(Sfe6,1,3,Gen(2))) + 
     &        CB2*F22*Sub17(Cha(3),Gen(2),Sfe6)*
     &         Sub9065(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,Sfe7)))/
     &    (CB2*S2B)

        Sub9073(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,Sfe7) = 
     &   Sqrt(2.D0)*(Mf(3,Gen(2))*Sub9041(HelAll(Cha(4)))*
     &       USf(Sfe6,1,3,Gen(2))*USf(Sfe7,2,4,Gen(1))) + 
     &    2*Sub9059(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe7)*
     &     USf(Sfe6,2,3,Gen(2))*USf(Sfe7,1,4,Gen(1))

        Sub9078(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,Sfe7) = 
     &   Sqrt(2.D0)*Sub9077(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,Sfe7) + 
     &    2*Mf(3,Gen(1))*Sub9073(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,
     &      Sfe7)

        Sub9081(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,Sfe7) = 
     &   Mino3C*Sub9079(HelAll(Cha(4)),Gen(1),Gen(2))*
     &     USf(Sfe6,1,3,Gen(2)) - 
     &    Sub9080(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe7)*
     &     USf(Sfe6,2,3,Gen(2))

        Sub9084(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,Sfe7) = 
     &   Sub9081(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,Sfe7)*
     &     USf(Sfe7,1,4,Gen(1)) + 
     &    Sub9083(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6)*
     &     USf(Sfe7,2,4,Gen(1))

        Sub9085(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,Sfe7) = 
     &   (2*(1/2.D0*(F22*S2B*Sub17(Cha(3),Gen(2),Sfe6)*
     &           Sub9078(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,Sfe7)) + 
     &        2*F19*SB2*Mf(4,Gen(2))*
     &         Sub9084(HelAll(Cha(3)),Cha(4),Gen(1),Gen(2),Sfe6,Sfe7)*
     &         UChaC(Cha(3),2)*USfC(Sfe6,1,3,Gen(2))))/(S2B*SB2)

        ENDLOOP(Sfe6)
        ENDLOOP(Sfe7)

